import React, { Component } from 'react';
import { Redirect } from 'react-router-dom';

class Loading extends Component {
  render() {
    const { redirectTo } = this.props;
    return (
      <div>
        <p>Carregando...</p>
        {console.log(redirectTo)}
        <Redirect to={ redirectTo } />
      </div>
    );
  }
}

export default Loading;
